      fetch('/nba',  {
        headers: {
          "Access-Control-Allow-Origin": "*"
        }
      })
        .then(response => response.json())
        .then(response => {
          console.log(response)
          this.setState({response: Object.keys(response).map(id => response[id])})
        });
    }


    render() {
      const response = this.state;
      console.log(response);
      this.items = response.map((item, key) =>
          <li key={item.team1Name}>{item.team1Score}</li>
      );

      return null;
    }

  }
